
//var nextMinute = current_date.getMinutes();
var step = 45;
const start_minute_from_8h = (60 * 8) + 30;
var last_difftime = 0;
var is_hidden = true;
function refreshTime() {
	const d = new Date();
	
	var speed_item = document.getElementById('id_dpv_img');
	if(null == speed_item)
	{
		speed_item = document.createElement('img');
		speed_item.id = 'id_dpv_img';
		speed_item.style.setProperty('display', 'none');
		speed_item.style.setProperty('position', 'fixed');
		speed_item.style.setProperty('left', '0px');
		speed_item.style.setProperty('top', '0px');
		speed_item.style.setProperty('width', '100%');
		speed_item.style.setProperty('height', '100%');
		speed_item.style.setProperty('z-index', '1000');
		
		document.body.appendChild(speed_item);
		speed_item.onclick = hidedpv;
		speed_item.setAttribute('src', 'data:image/jpeg;base64,');
		
		p_item = document.createElement('p');
		p_item.id = 'id_dpv_p';
		
		p_item.style.setProperty('display', 'none');
		p_item.style.setProperty('position', 'fixed');
		p_item.style.setProperty('text-align', 'center');
		p_item.style.setProperty('top', '49%');
		p_item.style.setProperty('width', '100%');
		p_item.style.setProperty('font-size', '49px');
		p_item.style.setProperty('z-index', '1100');
		p_item.style.setProperty('font-weight', 'bold');
		p_item.style.setProperty('color', 'red');
		document.body.appendChild(p_item);
		p_item.innerHTML = 'Dậy tập thể dục nào';
	}
	
	var id_dpv_p = document.getElementById('id_dpv_p');
	
	var diff_time = (60 * d.getHours()) + d.getMinutes() - start_minute_from_8h;
	if(diff_time < 0 || d.getHours() > 18)
	{
		setTimeout(refreshTime, 1000 * 60);
		return;
	}
	if(diff_time % step == 0 && d.getSeconds() < 4)
	{
		// last_difftime = diff_time;
		// setTimeout(refreshTime, 1000 * 60 * (step > 3 ? (step - 3) : 1));
		setTimeout(refreshTime, 60 * 1000);
		is_hidden = false;
		speed_item.style.setProperty('display', '');
		id_dpv_p.style.setProperty('display', '');
	}else{
		setTimeout(refreshTime, 1000);
		hidedpv();
	}
}    
    
setTimeout(refreshTime, 1000);
function hidedpv()
{
	if (is_hidden)
		return;
	
	is_hidden = true;
	
	var speed_item = document.getElementById('id_dpv_img');
	speed_item.style.setProperty('display', 'none');
	
	var id_dpv_p = document.getElementById('id_dpv_p');
	id_dpv_p.style.setProperty('display', 'none');
	
	localStorage.setItem("last_difftime_click", "value");
}